import { createSlice } from "@reduxjs/toolkit";
import axios from "axios";

const initialState = {
  searchTerm: "",
  searchCategory: "",
  searchResult: "",
};

export const Slice = createSlice({
  name: "auth",
  initialState,
  reducers: {
    signin: (state) => {
      state.isAuthenticated = true;
    },
    signout: (state) => {
      state.isAuthenticated = false;
    },
  },
});
